import React from "react";
import { Link } from "react-router-dom";
import "../styles/Home.css";
import profilePic from "../images/profilepic.jpg";

const Home = () => {
  return (
    <div className="home-container">
      <section className="hero">
        <div className="hero-content">
          <h2>Amandip Dutta</h2>
          <div className="bio">
            <p>
              I'm an undergraduate student at the University of California,
              Berkeley studying Computer Science and Statistics. My academic interests like in backend development, 
              ML/AI, and probabilisitc risk assessment. 
            </p>
            <p>
              Outside of academics, I enjoy weight-lifting, gardening, and going out for hikes in the bay area. Feel free to explore my website to learn more about my experiences and projects.
            </p>
          </div>
        </div>
        <div className="hero-image">
          <img src={profilePic} alt="Amandip" className="profile-pic" />
        </div>
      </section>
    </div>
  );
};

export default Home;
